$_MODULE['<{envoimoinscher}prestashop>getcontentcarriersadvanced_82705dcb9eb0d2fa861e7a1460988c74'] = 'Estos transportistas tienen restricciones de peso volumétrico. Debe definir las dimensiones de sus paquetes en función de su peso en la pestaña "Opciones de peso". Estos datos son uno de los criterios que condicionan las ofertas de entrega. Indique también las dimensiones más habituales para obtener las tarifas que más se aproximen a la realidad. Sin personalización, se utilizarán las dimensiones predeterminadas de Boxtale. En caso de declaración falsa, podrá facturársete un suplemento.';
$_MODULE['<{envoimoinscher}prestashop>getcontentcarriersadvanced_2232250ee32be99d57dc00cf482287f4'] = 'Elección de transportistas';
$_MODULE['<{envoimoinscher}prestashop>getcontentcarriersadvanced_d8190d914e7bb70c72b7a5d96f4af21b'] = 'Opciones de peso';
$_MODULE['<{envoimoinscher}prestashop>getcontentcarriersadvanced_ad40204f0f328a6cd5659de6ea8781d8'] = 'Transportistas : gastos de envio basados sobre el peso';
$_MODULE['<{envoimoinscher}prestashop>getcontentcarriersadvanced_ee997e0926d5480c2c780b354b040839'] = 'Transportistas : gastos de envio basados sobre el peso y las dimensiones';
$_MODULE['<{envoimoinscher}prestashop>getcontentcarriersadvanced_ab2bc85aa5a5806d1317873d58c99b06'] = 'En esta página puede personalizar las dimensiones máximas de sus envíos por rangos de peso. Le recomendamos efectuar este trabajo de personalización, puesto que las dimensiones son uno de los criterios principales para determinar el precio de las ofertas de entrega. Indique las dimensiones más habituales para obtener tarifas realistas.';
$_MODULE['<{envoimoinscher}prestashop>getcontentcarriersadvanced_95587963a159ed05c0139afdd77bba18'] = 'Sin personalización, se utilizarán las dimensiones predeterminadas de Boxtale.';
