$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_6c92285fa6d3e827b198d120ea3ac674'] = 'aquí';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_dde54e8e96cf3c1e893d6a6922b9aaa0'] = 'http://ecommerce.EnvoiMoinsCher.com/api/download/doc_prestashop_expedier.pdf';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_a74cca1f4c6ea8ca0b2f4c701146f620'] = 'Para obtener más información, consulte la documentación:';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_6b6336af20e7782c3a1728b53f769b7d'] = 'Instalación, activación y prueba del módulo';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_48f2703eed2d7eb8fb667a6c64c4a648'] = 'Puede <b>probar si los Configuración de tu módulo son correctos antes de activar el modo de producción. Para realizar una prueba, activa el entorno de trabajo en modo test.</b> Para ello, marca la pestaña correspondiente en la parte superior del módulo Boxtale.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_4c270cd877fc7c8a28fe5bd02e13ce7a'] = '<b>La página de simulación del módulo</b> te permite generar <b>presupuestos de transporte para los artículos de tu catálogo</b>, así como <b>verificar los gastos de envío</b> que se mostrarán en el front-office.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_72f18192ff41351066502113fd2c4177'] = '¿Cómo activar el módulo en modo de producción?';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_e5c105ee58cc0de0c4941bb159ef3af1'] = 'Para <b>activar el entorno de trabajo en modo de producción</b>, marca la pestaña correspondiente en la parte superior del módulo Boxtale.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_8afe2f6fd563e96aab3eef01e75e5e91'] = 'He activado el módulo en modo de producción, pero aparece el error: "Invalid account payment method". ¿Qué debo hacer?';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_61fb2dac6d4114df558ed291416d9e6b'] = '<b>Para que el módulo funcione, debe activar el pago diferido por domiciliación. Este error aparece si intentas utilizar el módulo en modo de producción sin estar en pago diferido.</b>';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_675c1c3e4f86449b43ef760dc3a3ed6b'] = 'Puede cambiar a pago diferido desde la pestaña Preferencias de su cuenta o a través de la dirección siguiente:';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_aa6021c991bc990f0328687c9cc6598c'] = 'compta@boxtale.com';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_cbbb59b9b2bca6bc421a83d17dd01431'] = 'Debe enviarnos su usuario, los datos bancarios y una autorización de domiciliación.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_bf8de457ecf44c68ea87646ad7eb5c6d'] = 'Se muestra el error siguiente: "Error: Contact our billing service". ¿Qué debo hacer?';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_2fab69989656cfc50fc3d70082fba0a4'] = '<b>Este error está asociado a un problema de pago. Es posible que haya alcanzado el máximo autorizado para su cuenta. </b>Contacte nuestro servicio de contabilidad, indicando su usuario, a través de la dirección siguiente: ';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_2deef408a7f10af4b7b081690987aff6'] = 'Configuración general del módulo';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_0ebe4ebd22232e6a3222abb200b1c956'] = '¿Cómo configuro la pestaña "Cuenta comercial"?';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_dd46597b02dc8377cd6e602bd0b6f427'] = 'Su usuario y su contraseña son los que seleccionó al crear su cuenta en el sitio web';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_af126829f14642d693bac25314ebdf08'] = 'http://www.boxtale.es/';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_f92c132e4e3b634351cb21b26ff18e26'] = 'www.boxtale.es';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_713e174863bfead191b7b9e792b4416b'] = 'Estos datos de acceso también le permiten acceder a su cuenta en el sitio web. El servicio técnico le envió la clave API en respuesta a su solicitud.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_5a04539de1fd5e68bf2d8412cec29dcc'] = '<b>Inicialmente, seleccione la clave API de test</b> para configurar el módulo y luego probarlo.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_d21026dcdec91239c48903c1071e24a4'] = '<b>Una vez terminada la configuración y concluidas las pruebas, podrá cambiar definitivamente a la clave API de producción.</b>';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_09167c61382cc01135a18f479a00e4f8'] = 'Una clave de producción puede utilizarse en varios sitios web. Si su empresa de facturación es la misma para sus distintas tiendas virtuales, puede utilizar la misma clave en todas ellas. De lo contrario, le recomendamos crear una nueva cuenta y solicitar una nueva clave.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_0cdfe63e6e723b725b02f84ff46e5fb9'] = '¿Cómo configuro la pestaña "Descripción de los envíos"?';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_e5f9b0598e891ae7fbc5adddec58e8c9'] = '<b>Selecciona tu tipo de envío: carta, paquete o paleta.</b>';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_b399ffd419f9cf8a2c6a7882c0282908'] = '<b>Atención:</b> le recomendamos seleccionar &quot;paquete&quot; aunque realice envíos en sobres acolchados. Las ofertas de entrega en puntos de recogida no son compatibles con la categoría &quot;carta&quot;.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_d6ee3823ffc8cd40606d0cfbc403d85e'] = '<b>Seleccione la categoría de sus envíos entre las disponibles en el menú desplegable.</b> Si su sitio web distribuye más de una categoría, seleccione la categoría predominante.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_fe29993590c0323a4932c9649f7f0d86'] = '<b>Atención:</b> algunos tipos de envío no permiten utilizar ciertos transportistas. No dude en contactar nuestro servicio de atención al cliente para conocer las distintas restricciones aplicables al envío de productos específicos.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_04f4c266f544dbd6aeacadf5020bb6bd'] = 'Solo es necesario especificar el tipo de embalaje si selecciona ofrecer una o más de las opciones Colissimo disponibles en el módulo. Si realizas envíos en tubo, se aplicará un suplemento de 6 euros al coste del envío por cada paquete expedido.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_658fdcc72b95d960649e1fbd7015246d'] = '¿Cómo configuro la pestaña "Transportistas"? ¿Cómo indico los Configuración de los transportistas en PrestaShop?';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_6850103a7124d9e791d47625273dd932'] = 'Seleccione sus transportistas entre los disponibles en la lista. Al activar un transportista, opte por ofrecer sus servicios a sus clientes. A continuación, debe determinar si el transportista se ofrecerá con su precio real o con un precio fijo.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_dc78d91d53a00adca7ecb67f1809e296'] = '<b>precio real</b>: los gastos de envío que se mostrarán en el front-office serán los recibidos directamente de Boxtale.es, sin modificaciones. Es el precio exacto del servicio de entrega. Si selecciona aplicar el modo &quot;precio real&quot; a una oferta, ya no necesitas configurar nada más.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_e58a408316900f5ca0cb14a9f060206c'] = '<b>precio fijo</b>: los gastos de envío que se mostrarán en el front-office serán los que usted mismo hayas definido.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_7e2f8fdcedff32a47e66670951275e35'] = 'Para establecer su precio fijo en PrestaShop, visite el menú Entrega/Transportista y defina sus propios valores en función del peso o del precio del carrito.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_8e253d72bcac5d56668ccc85b5d8ea95'] = '¿Cuál es la diferencia entre los transportistas &quot;sencillos&quot; y los transportistas &quot;avanzados&quot;? ¿Cómo configuro los transportistas avanzados en el módulo Boxtale?';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_636cdbd30635ad7dee957937c69a7487'] = 'Los <b>transportistas sencillos</b> calculan sus tarifas en función del peso de los paquetes.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_89cd2c49babdc21e3889172c3ef33b77'] = 'Los <b>transportistas avanzados</b> son servicios exprés para Francia o internacionales, que calculan sus tarifas tanto en función del peso de los paquetes como de las dimensiones del envío.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_6654c1357367ef216ab5123bcc3368a8'] = 'Dado que el volumen de un paquete no puede calcularse en tiempo real cuando el cliente realiza un pedido en línea, debe definir una tabla de equivalencia entre peso y volumen anticipadamente. De esta manera, el módulo tomará la dimensión correspondiente al peso calculado para el carrito del cliente y mostrará el coste del transporte correspondiente.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_a8dcfa18faf4ca004e8d6b424fdce5fc'] = 'Por tanto, debe personalizar sus propios pesos y dimensiones en la pestaña &quot;Opciones de peso&quot; del módulo si no quiere usar las dimensiones predeterminadas.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_645bd591803fc222f29eca86407f9d0b'] = '¿Cómo puedo ofrecer el envío gratuito con el módulo Boxtale?';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_5eae20df80180d4229cdb7acfda2731a'] = '<b>Atención</b>: no active la opción &quot;gastos de envío gratuitos&quot; en PrestaShop. La configuración del envío gratuito puede hacerse mediante la configuración de los rangos por transportista. No obstante, si activas esta opción, los transportistas de Boxtale que no sean pertinentes para el pedido aparecerán, pero se desactivarán en el front-office para evitar problemas de facturación.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_890d3769c0e389ffb5cc959b11dd1da0'] = 'Selecciona <b>&quot;restitución del precio&quot; en la opción de &quot;precio fijo&quot;</b> para el transportista deseado en el módulo, en la pestaña &quot;transportista sencillo&quot; o &quot;transportista avanzado&quot;. A continuación, en <b>la pestaña &quot;Transporte > Transportistas&quot; seleccione el transportista deseado y defina los rangos deseados</b> en la sección &quot;destinos de expedición y costes&quot;.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_c1416f436f7082e9c11106f30969b7ce'] = '<b>Por ejemplo</b>: si quiere ofrecer gastos de envío gratuitos para un transportista a partir de 50 € de pedido, define el rango de 0 a 50 € con los gastos de envío deseados (p. ej., 5 €) y crea un segundo rango de 50,01 € a 100.000 € con 0 € como gastos de envío.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_90921ebf20af7fc504a347d030fcb4f3'] = '¿Puedo expedir mis paquetes si funciono en modo Justo a tiempo?';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_b7291ba0803aaff33c1f2a579a316f01'] = '<b>El modo de funcionamiento Justo a tiempo no crea problemas con nuestro módulo.</b> El módulo distingue el pedido del cliente del pedido de transporte en sí mismo, que se origina cuando haces clic en &quot;expedir&quot;. Por lo tanto, cuando un cliente haga un pedido en tu sitio web, solo tendrás que hacer clic en &quot;Expedir&quot; una vez que el paquete esté listo.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_06750acf8426d67f8a8a05399465e537'] = 'Problemas más frecuentes al configurar el módulo';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_05be32ff926c8114bf5973e26dca34ca'] = 'No aparecen las ofertas seleccionadas.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_46722e5956bda571d84d8ba924eda2f8'] = '¿Por qué obtengo precios diferentes al realizar la simulación en el sitio web de Boxtale y en mi back-office?';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_d8b126d9f6ceefa09958ce3f4122dcff'] = 'El módulo restituye por defecto los precios sin IVA. Debe <b>configurar el IVA en PrestaShop.</b> Para ello, visite la pestaña Transportista y modifica la tasa del IVA.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_ecb8b2e3be50706e45464a1ffec691d5'] = 'Expedición, seguimiento y seguro de los envíos';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_fb793042cb3b421b87798a33de85fc20'] = '¿Dónde debo ir para enviar mis pedidos?';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_202edf2edf94445b4e655c036f7f7d53'] = 'Vaya a la <b>pestaña Transportistas y haz clic en la subpestaña Boxtale.</b>';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_e69c2fafff124002622fa0e0ff767c9c'] = '¿Cómo se lee la tabla de pedidos?';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_5c8ea9f93062cb5becd24198f5a74a90'] = 'Se muestran tres tablas:';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_ef9568a670b7b789aa245466bd15e080'] = '<b>pedidos con transportista Boxtale seleccionado</b>: son pedidos para los cuales el comprador ha seleccionado uno de los transportistas del módulo.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_2d1a7ee1a20811a3ab58773e31994c26'] = '<b>pedidos sin transportista Boxtale seleccionado</b>: son pedidos para los cuales el comprador ha seleccionado un transportista distinto a los propuestos por el módulo. Si desea utilizar un transportista del módulo Boxtale de todos modos, deberá seleccionar para cada uno de ellos el transportista Boxtale antes de generar el envío. Por tanto, deberá visitar la pantalla de verificación de los datos de cada envío para rellenar los datos.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_17934c413a0e4e23d3185ab227764b54'] = '<b>pedidos incompletos</b> (faltan datos) <b>o no válidos</b> (p. ej., número de teléfono del destinatario incorrecto).<br/> Se trata de pedidos para los que faltan datos (p. ej., la oferta de transporte seleccionada por el comprador ya no está disponible) o que tienen errores de validación (número de teléfono del destinatario incorrecto, etc.).<br/>';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_037ecabea6745aa4c51ef6f386027558'] = 'A menudo se tratará de pedidos que no han podido ser expedidos a través de la tabla n.º 1. En consecuencia, se incluyen en esta para que puedas corregirlos y expedirlos posteriormente. Para ello, pasará automáticamente por la pantalla de verificación de los datos de cada envío y corregir los datos. Si la oferta ya no está disponible, podrá seleccionar una nueva oferta de transporte que sustituya a la antigua (no olvide comunicárselo al cliente).';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_b43031b8d99503165801c7cfccc0666f'] = '¿Cómo expido mis pedidos uno por uno con los transportistas Boxtale seleccionados?';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_c3799a3d5b256b30cceff4902d048e5a'] = 'Haga clic en el botón \"Expedir\" situado en el extremo derecho de la línea del pedido.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_86fff905a6d92a49de547a1c4e81748f'] = 'Se muestra una página de confirmación de la expedición. No tiene que introducir datos complementarios, pero en caso necesario puedes modificarlos: fecha de recepción (si es una oferta con recogida), peso del pedido, datos del destinatario…';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_98347d7f2ca93178cfb36112a1757387'] = 'Para finalizar, haz clic en "Expedir".';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_281abdf991e7956ad8f8b2e8c476e429'] = 'Si se trata de una oferta con recogida en una tienda, la solicitud de recogida se envía automáticamente al transportista.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_5d2d48cf44aa1f3a0f83a13df66a7a44'] = 'Si todos los envíos son correctos, se archivan en el historial de envíos procesados y se muestra un mensaje de confirmación.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_266c529f84ea599b1405c83320675e99'] = 'Si surge algún problema con uno o más envíos, estos se clasifican en la tabla de pedidos incompletos o no válidos, para que pueda corregirlos y expedirlos posteriormente.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_84991c9189c680ce279faf4d63d24dd7'] = '¿Cómo expido pedidos por lotes con los transportistas Boxtale seleccionados?';
