$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_83384dc9945fdf9ada6d6b9428ee2c75'] = 'De hecho, cuando el comprador realiza el pedido en su tienda virtual, abone el precio del envío en un solo paquete. Si, al enviar el pedido, decide utilizar la opción multipaquete, el presupuesto se basará en varios paquetes. Por lo tanto, puede suceder que la tarifa resultante sea mayor o menor que el precio abonado por el comprador. Téngalo en cuenta antes de usar la opción multipaquete.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_921d6c3ad23f8820e762422c7ddc21cb'] = 'Las etiquetas de envío emitidas se facturan, tanto si se utilizan como si no (por ejemplo, 2 etiquetas de envío y 1 paquete final = 2 etiquetas de envío facturadas).';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_fa1eb8aaa46f236154dcc912a423f1b4'] = '¿Cuáles son las particularidades de los envíos al extranjero?';
