$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_11bd04e87454e394531e588060f4fdc8'] = '¿Puedo probar mi módulo antes de activarlo en el front-office?';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_cc0b86ba6115a80bc7ec78b94a04d59c'] = 'La página de simulación te permite efectuar presupuestos para tus artículos:';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_73699677bd8b78e71ea35e7b54be1deb'] = 'Las ofertas elegidas no aparecen';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_aa1d3fb77faecb270f3876e3d642e3bb'] = 'Si al hacer un pedido desde el front-office no aparece ninguna oferta del módulo Boxtale, revisa los puntos siguientes:';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_e571329278c2aaf471bb41035b1701f7'] = '¿Está el módulo en estado "Público"?';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_146a8ac7ced910a469961678040968be'] = 'Ten en cuenta que el módulo debe ser público para que funcione en el front-office. Si ya has terminado de configurarlo, cámbialo al estado "Público"; para ello, haz clic en el aspa roja situada ante el "Estado del módulo" en la parte superior izquierda de esta página.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_0c3ff77dc4d7c6ee71f41da06930b8f0'] = '¿Son correctos mis datos de acceso?';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_4c3a689efd04fb1d4b7e6f653d1f7dd1'] = 'Si no es así, se muestra un mensaje de error en la parte superior de la página.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_5c30cea08ff2bdcf919c5de22cc2a6ee'] = '¿Se han hecho configuraciones recientes de mis transportistas?';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_165050391b40524d5d9921f680698dfc'] = 'En tal caso, puede que las modificaciones aún no se hayan activado. Vaciar la caché (parte superior izquierda de esta página) debería resolver el problema.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_b8bdb352fdd815f9f7418f139dbc2ce6'] = '¿Tienen mis artículos un peso indicado (en Catálogo -> Productos -> Editar producto -> Transporte)?';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_87b000ba6c126f0ea8dcc044f156f2fc'] = 'El módulo no puede mostrar los gastos de envío para artículos sin peso, pero es posible establecer un peso por defecto para los artículos en la pestaña "Descripción de los envíos".';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_54f7fca5d538d1e9f2f2e3a67cc8cb6d'] = '¿Está el módulo activado?';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_a5ee8fbd6f56add40e04bce7398c78da'] = 'Puedes comprobarlo en la lista de módulos.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_dea606020ef9b6ffc60198088f8dc1f7'] = '¿He indicado una dirección válida en mi cuenta en el front-office?';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_2d24c5ba00cc6b1b0577e6e1e8fc579f'] = 'Es posible que el transportista no reconozca el formato de dirección indicado. Prueba con una dirección sencilla, como 75002 / París / rue de la Paix.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_e4f2a5370b5653658778005a59a4c335'] = '¿Las ofertas siguen sin aparecer? Seguro que hay mensajes en el registro relativos a Boxtale (comienzan por "[BOXTALE]"). Ponte en contacto con el servicio técnico (informationAPI@boxtale.com) e indícanos los mensajes que aparecen en el registro, junto con los datos de acceso al back-office, para acelerar la resolución del problema. Te responderemos en un plazo de 24 horas.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_c7a9711ebce1a0ef420699f6dbb6dbb9'] = 'Haz clic aquí para acceder a tus registros: ';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_42c5c6df7d58d8e75a32bf2148983e4d'] = 'Los precios no se corresponden con los que yo he configurado.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_423ce067749bbbe3530e0c8cf6fc84b6'] = 'Si al realizar un pedido desde el front-office, los precios indicados para los transportistas Boxtale no se corresponden con los que has indicado, revisa los puntos siguientes.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_448a46781993b4d059dde60383325ad0'] = 'Si utilizas el "precio real" (precio fijado por Boxtale) para tus transportistas:';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_7d3c22f72179c00f2e84a2877f36bc46'] = '¿Es correcto el peso/volumen de mi artículo?';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_01d040b0bdb0e12126850b1afd70393a'] = 'El precio se calcula en función del peso de los artículos y del volumen (solamente transportistas avanzados). Por tanto, es necesario comprobar si el peso de los artículos (en Catálogo -> Productos -> Editar producto -> Transporte) es correcto y si se ha seleccionado la unidad de peso adecuada. Si no se indica ningún peso, verifica también el peso por defecto en la pestaña "Descripción de los envíos". Por último, para los transportistas avanzados es necesario configurar la tabla de volumen de los envíos en la pestaña "Transportistas avanzados".';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_c637a8677c71c9720a856c2f7c202cbd'] = 'Si estableces un "precio fijo" (fijado por ti) para tus transportistas:';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_fd2d25fb24d5a19f95538146fee65811'] = '¿Están mis transportistas en modo "precio fijo"?';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_1b55814f3f8233ebf3657e4eb25c78b8'] = 'Para poder utilizar tu configuración de precios, debes indicar tus transportistas de "precio fijo" en las pestañas "Transportistas sencillos" y "Transportistas avanzados".';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_12a29be76cd9033641c18b927806e016'] = '¿He configurado bien mis rangos?';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_122a271ec8ad61e0881bd1bde7612520'] = '¿Es el precio el indicado en los rangos de peso/precio (Transporte -> Transportistas -> Editar transportista)? Es necesario comprobar que los rangos sean correctos.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_2aee1c96bddcf897b821d09e107be08f'] = '¿Los precios siguen siendo incorrectos? Ponte en contacto con el servicio técnico (informationAPI@boxtale.com) e indícanos los datos de acceso a tu back-office para acelerar la resolución del problema. Te responderemos en un plazo de 24 horas.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_c3b0b604abfb9a350d244e1eb887b522'] = 'Los puntos de recogida no aparecen';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_88e3db595c2b230d8553f801af39fe18'] = 'Si tu transportista para puntos de recogida se muestra en el front-office pero los puntos de recogida no, revisa los puntos siguientes:';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_be6d7c4fdae93d4ae2d43ebbb7b8026f'] = '¿Estoy usando un tema personalizado?';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_5988347880a6c7f3927a1f06d2bc167a'] = 'Un tema personalizado suele ser la razón por la cual no aparecen los puntos de recogida. Si usas uno, contacta con tu webmaster para cargar provisionalmente el tema predeterminado y vaciar la caché smarty. Si los puntos de recogida se muestran normalmente al retirar el tema personalizado, tu webmaster deberá incorporar el archivo "order-carrier.tpl" del tema predeterminado a tu tema personalizado.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_252326fc237811bc3cf2ee0c02e90946'] = '¿Está activada la opción "Envío gratuito" (en Transporte -> Preferencias)?';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_2a097705a8e3a45d204e3ac2e6c792e5'] = 'Lamentablemente, esta opción plantea problemas con los módulos de transporte. De hecho, estos se desactivan en cuanto se activa el envío gratuito. Por ello, te aconsejamos utilizar los rangos de precios para ofrecer el envío gratuito (es suficiente con un rango de precios de 0 €).';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_782a7eeae1402f2ea88497cfa4cfd18b'] = '¿Hay un punto de recogida cerca de mi dirección de entrega?';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_9b004befe1bb4a111143913c508c561d'] = 'Aunque es poco frecuente, a veces no hay ningún punto de recogida en una región. Para estar seguro, prueba con una dirección de entrega sencilla, por ejemplo 75002 / París / rue de la Paix.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_228ed76edd298514990cc1b679fc52b4'] = '¿Los puntos de recogida siguen sin aparecer? Ponte en contacto con el servicio técnico (informationAPI@boxtale.com) e indícanos los datos de acceso a tu back-office para acelerar la resolución del problema. Te responderemos en un plazo de 24 horas.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_5741ceb5ecc370599a79ab29727a8edb'] = 'Mi etiqueta de envío no se genera después de una expedición.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_82782d529ec83c09dfc3d892dc86d38c'] = 'Después de expedir un pedido Boxtale, en la lista de envíos expedidos debe aparecer un enlace para descargar la etiqueta de envío. Si este enlace sigue en proceso de generación, revise los siguientes puntos:';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_e723a5a7980fdba0de9c7254cf66db6e'] = '¿He esperado suficiente tiempo?';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_46195a5b27e3967e318bcee302fa0f63'] = 'Según el transportista, la generación puede tardar hasta 5 minutos. Espera un poco.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_4bca038cdde2f92997bdb4108d382085'] = '¿Estoy en el entorno de pruebas?';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_2946b4aaf998509aad67e9bec809a20c'] = 'En tal caso, el pedido no se ha procesado realmente y la etiqueta de envío no se generará. Si su pedido era real, debe primero cambiar al entorno de producción (parte superior izquierda de la página "Entorno de trabajo") y reenviar el pedido a nuestro sitio web; no olvide iniciar sesión en su cuenta para que el pedido se incluya en su factura. Haga clic aquí para acceder al sitio web Boxtale.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_236b2d6be1145873a68c73a05f0cf473'] = '¿Su etiqueta de envío sigue sin generarse? Póngase en contacto con el servicio técnico (informationAPI@boxtale.com) e indíqueno los datos de acceso a su back-office para acelerar la resolución del problema. Le responderemos en un plazo de 24 horas.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_138dfc67b7698890ff87c06110cc6796'] = 'Si tiene cualquier otra pregunta, estamos a su disposición:';
